import { IonIcon, IonItem, IonLabel, IonList, IonTitle, IonToolbar } from "@ionic/react";
import { menu, send } from "ionicons/icons";
import Title from "../../components/Title";

import menus from './assets/menu.json';


const Gasto:React.FC = () => { 

    return (<>
        <Title  name=''Menus/>
        <IonList className='lista-menus'>
            {menus.map((m: any) => <IonItem routerLink={m.route} key={m.route} >
                <IonIcon slot="start" icon={menu} />
                <IonLabel>{m.title}</IonLabel>
                <IonIcon slot="end" icon={send} />
            </IonItem>)}
        </IonList>
    </>);
}


export default Gasto;
